new MatchFilter() {

    public final boolean acceptMatch(CharSequence s, int start, int end) {
        if (start == 0) {
            return true;
        }
        if (s.charAt(start - 1) == '@') {
            return false;
        }
        return true;
    }
}

new MatchFilter() {

    public final boolean acceptMatch(CharSequence s, int start, int end) {
        int digitCount = 0;
        for (int i = start; i < end; i++) {
            if (Character.isDigit(s.charAt(i))) {
                digitCount++;
                if (digitCount >= PHONE_NUMBER_MINIMUM_DIGITS) {
                    return true;
                }
            }
        }
        return false;
    }
}

new TransformFilter() {

