new BroadcastReceiver() {

    @Override
    public void onReceive(Context context, Intent intent) {
        String action = intent.getAction();
        BluetoothDevice device = intent.getParcelableExtra(BluetoothDevice.EXTRA_DEVICE);
        if (action.equals(BluetoothAdapter.ACTION_STATE_CHANGED)) {
            int state = intent.getIntExtra(BluetoothAdapter.EXTRA_STATE, BluetoothAdapter.ERROR);
            switch(state) {
                case BluetoothAdapter.STATE_ON:
                    onBluetoothEnable();
                    break;
                case BluetoothAdapter.STATE_TURNING_OFF:
                    onBluetoothDisable();
                    break;
            }
        } else if (action.equals(BluetoothDevice.ACTION_BOND_STATE_CHANGED)) {
            int bondState = intent.getIntExtra(BluetoothDevice.EXTRA_BOND_STATE, BluetoothDevice.ERROR);
            switch(bondState) {
                case BluetoothDevice.BOND_BONDED:
                    if (getPriority(device) == BluetoothA2dp.PRIORITY_UNDEFINED) {
                        setPriority(device, BluetoothA2dp.PRIORITY_ON);
                    }
                    break;
                case BluetoothDevice.BOND_NONE:
                    setPriority(device, BluetoothA2dp.PRIORITY_UNDEFINED);
                    break;
            }
        } else if (action.equals(BluetoothDevice.ACTION_ACL_DISCONNECTED)) {
            synchronized (this) {
                if (mAudioDevices.containsKey(device)) {
                    int state = mAudioDevices.get(device);
                    handleSinkStateChange(device, state, BluetoothA2dp.STATE_DISCONNECTED);
                }
            }
        } else if (action.equals(AudioManager.VOLUME_CHANGED_ACTION)) {
            int streamType = intent.getIntExtra(AudioManager.EXTRA_VOLUME_STREAM_TYPE, -1);
            if (streamType == AudioManager.STREAM_MUSIC) {
                List<BluetoothDevice> sinks = getConnectedDevices();
                if (sinks.size() != 0 && isPhoneDocked(sinks.get(0))) {
                    String address = sinks.get(0).getAddress();
                    int newVolLevel = intent.getIntExtra(AudioManager.EXTRA_VOLUME_STREAM_VALUE, 0);
                    int oldVolLevel = intent.getIntExtra(AudioManager.EXTRA_PREV_VOLUME_STREAM_VALUE, 0);
                    String path = mBluetoothService.getObjectPathFromAddress(address);
                    if (newVolLevel > oldVolLevel) {
                        avrcpVolumeUpNative(path);
                    } else if (newVolLevel < oldVolLevel) {
                        avrcpVolumeDownNative(path);
                    }
                }
            }
        }
    }
}

