            byte[] addr = in.createByteArray();
            prefix = in.readInt();
            try {
                destAddr = InetAddress.getByAddress(addr);
            } catch (UnknownHostException e) {
            }
        }
        if (in.readByte() == 1) {
            byte[] addr = in.createByteArray();
            try {
                gateway = InetAddress.getByAddress(addr);
            } catch (UnknownHostException e) {
            }
        }
        LinkAddress dest = null;
        if (destAddr != null) {
            dest = new LinkAddress(destAddr, prefix);
