new View.OnKeyListener() {

    public boolean onKey(View v, int keyCode, KeyEvent event) {
        // guard against possible race conditions
        if (mSearchable == null) {
            return false;
        }
        if (DBG) {
            Log.d(LOG_TAG, "mTextListener.onKey(" + keyCode + "," + event + "), selection: " + mQueryTextView.getListSelection());
        }
        // as presses on the selected suggestion
        if (mQueryTextView.isPopupShowing() && mQueryTextView.getListSelection() != ListView.INVALID_POSITION) {
            return onSuggestionsKey(v, keyCode, event);
        }
        // The search key is handled by the dialog's onKeyDown().
        if (!mQueryTextView.isEmpty() && event.hasNoModifiers()) {
            if (event.getAction() == KeyEvent.ACTION_UP) {
                if (keyCode == KeyEvent.KEYCODE_ENTER) {
                    v.cancelLongPress();
                    // Launch as a regular search.
                    launchQuerySearch(KeyEvent.KEYCODE_UNKNOWN, null, mQueryTextView.getText().toString());
                    return true;
                }
            }
            if (event.getAction() == KeyEvent.ACTION_DOWN) {
                SearchableInfo.ActionKeyInfo actionKey = mSearchable.findActionKey(keyCode);
                if ((actionKey != null) && (actionKey.getQueryActionMsg() != null)) {
                    launchQuerySearch(keyCode, actionKey.getQueryActionMsg(), mQueryTextView.getText().toString());
                    return true;
                }
            }
        }
        return false;
    }
}

