new BroadcastReceiver() {

    @Override
    public void onReceive(Context context, Intent intent) {
        String action = intent.getAction();
        BluetoothDevice device = intent.getParcelableExtra(BluetoothDevice.EXTRA_DEVICE);
        if (action.equals(BluetoothHeadset.ACTION_CONNECTION_STATE_CHANGED)) {
            int newState = intent.getIntExtra(BluetoothProfile.EXTRA_STATE, 0);
            if (mProfile == HFP && (newState == BluetoothProfile.STATE_CONNECTED || newState == BluetoothProfile.STATE_DISCONNECTED)) {
                sendMessage(TRANSITION_TO_STABLE);
            }
        } else if (action.equals(BluetoothA2dp.ACTION_CONNECTION_STATE_CHANGED)) {
            int newState = intent.getIntExtra(BluetoothProfile.EXTRA_STATE, 0);
            if (mProfile == A2DP && (newState == BluetoothProfile.STATE_CONNECTED || newState == BluetoothProfile.STATE_DISCONNECTED)) {
                sendMessage(TRANSITION_TO_STABLE);
            }
        } else if (action.equals(BluetoothInputDevice.ACTION_CONNECTION_STATE_CHANGED)) {
            int newState = intent.getIntExtra(BluetoothProfile.EXTRA_STATE, 0);
            if (mProfile == HID && (newState == BluetoothProfile.STATE_CONNECTED || newState == BluetoothProfile.STATE_DISCONNECTED)) {
                sendMessage(TRANSITION_TO_STABLE);
            }
        } else if (action.equals(BluetoothDevice.ACTION_ACL_DISCONNECTED)) {
            if (device.equals(mPendingDevice)) {
                sendMessage(TRANSITION_TO_STABLE);
            }
        }
    }
}

